  `driver_night_pay_rate` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `day_shift_time` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `night_shift_time` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `day_shift_charge` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `day_shift_pay` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `night_shift_charge` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `night_shift_pay` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
