  `role` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `cancelReason` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `finalSubmit` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Pending',
